import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div>
      <h1>TodoList</h1>
      <TaskList name="Todo" tasks={['but the milk', 'call Mom!']}/>
      <TaskList name="WIP" tasks={['React Project', 'FP In Scala']}/>
    </div>
  );
}

export default App;
